import React from "react";
import User from "./components/user/user";
import Task from "./components/task/task";
import Card from "./components/cards/card";
import Navbar from "./shared/compoents/navbar";
import Form from "./components/product/product_form/product_form";

import { BrowserRouter as Router,Route,Switch,Redirect } from "react-router-dom";
import ProductForm from "./components/product/product_form/product_form";
import ShowProduct from "./components/product/show_product/showProduct";
import ProductCard from "./components/cards/product_card";

import './App.css'
const data = ['tea', 'coffee', 'water']

function App() {

  let title="Bobby";

  return (

   <div>
   <React.Fragment>
      <Navbar />

      <Router>
      <Switch>

<Route path="/" exact>


        <ProductForm/>     
        {/* <ProductCard/> */}
            {/* <Card title="Bobby"></Card> */}

          </Route>

      <Route path="/form">

      {console.log('working')}

        <Form/>

      </Route>



          <Route path="/home" exact>

            <Task/>

          </Route>



          <Route path="/prodForm" exact>

          <ProductForm name="Bobby"/>

          </Route>


          <Route path="/showProd" exact>

          <ShowProduct/>

          </Route>





          <Route path="/create" exact>
            <User data={data}/>
          </Route> 

          <Redirect to="/"/>




          </Switch>

        </Router>


        </React.Fragment>



        </div>






  );
}

export default App;
